import React from "react";
import notes from "../notes.js";

function createCard(notes){
    return(
        <Card 
            key = {notes.key}
            title = {notes.title}
            content = {notes.content}
        />
    );
}

function Note(){
    return (
        <div className = "note">
            notes.map(creteCard)}
        </div>
    );
}

export default Note;
